import React from 'react';
import Breakfast from '../components/Meals/Breakfast'
import Lunch from '../components/Meals/Lunch'
import Dinner from '../components/Meals/Dinner'
import { makeStyles } from '@material-ui/core/styles'
// import $ from "../nutritionLabel"
import {InputBase} from "@material-ui/core"
const Authorization = () => {

  const useStyles = makeStyles((theme) => ({
   inputRoot: {
    color: 'inherit',
  },
  inputInput: {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('md')]: {
      width: '20ch',
    },
  },
  search: {
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: fade(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: fade(theme.palette.common.white, 0.25),
    },
    marginRight: theme.spacing(2),
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing(3),
      width: 'auto',
    },
  },
  searchIcon: {
    padding: theme.spacing(0, 2),
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  }
}))

  return (
    <header className="App-page">
       <h1>Your Food Log</h1>
       {/* {$('#test1').nutritionLabel()} */}
        <div className='rowC'>
            <div className="container-1">
              <h1>Calendar</h1>
              </div>
            <div className='container-2'>
            <div className={classes.search}>
                <div className={classes.searchIcon}>
                  <SearchIcon />
                </div>
                <InputBase
                  placeholder="Search…"

                  classes={{
                    root: useStyles().inputRoot,
                    input: useStyles().inputInput,
                  }}
                  inputProps={{ 'aria-label': 'search' }}
                  />
            </div>
                <div className='s-meal'><Breakfast /></div>
                <div className='s-meal'><Lunch /></div>
                <div className='s-meal'><Dinner /></div>


            </div>
        </div>
    </header>

  )
}



export default Authorization;

